import React from "react";
import "../../css/cardsStyle/cardOne.css";

const CardOne = () => {
  return (
    <div className="cardOneFlexContainer">
      <div className="CardOneSprite">
        <ul>
          <img width="64" height="64" src="../../img/personaOne.jpg" alt="" />
        </ul>
      </div>
    </div>
  );
};

export default CardOne;
